import React from 'react';

import { Switch, Route } from 'react-router-dom';

import Users from './Users';
// import About from './About';

function Reducers() {
    return (
        <Switch>
            <Route path="/users" component={ Users } />
            {/* <Route path="/about" component={ About } /> */}
        </Switch>
    );
}

export default Reducers;
